import React from "react";
import {Link} from "react-router-dom";
function Component3() {
    return ( 
        <>
        <div >
        <div className="container p-5">
            <div className="row text-center ">
                <div className="col-2"></div>
                <div className="col-8">
                <h1 className="mt-5 fs-2">More Articles Coming Soon</h1>
                <p className="fs-5 mt-3">We're working on more in-depth guides about habit formation, productivity tips, and the science behind visual tracking. Stay tuned for more insights!</p>
                <Link to={"/login"}><button className="btn  m-3 p-2 coloured-btn">Start Building Habits</button></Link>
                <button className="btn btn-outline-secondary m-2 p-2" >Learn More About Habitualy</button>
                </div>
                <div className="col-2"></div>
            </div>
        </div>
        </div>
        </>
     );
}

export default Component3;
